export function fetchKlasses() {
  return (dispatch) => {
    console.log("action fetchKlasses is called!")
    dispatch({type: 'START_ADDING_KLASSES_REQUEST'})
    fetch(`/klasses`)
      .then(resp => resp.json())
      .then(json => dispatch({ type: 'ADD_KLASSES', json }))
  }
}
